import './App.js'
import createSudoku from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
let sudoku=createSudoku()
const root=ReactDOM.createRoot(document.getElementById('root'));
class Sudoku extends React.Component{
     constructor(props)
     {
      super(props)

     }
     render(){
      return(
        this.props.arr.map((temp)=><Row arra={temp}/>)
      )
     }
}
class Row extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return (
      this.props.arra.map((temp)=><h>{temp}</h>)
    )
  }
}
root.render(<Sudoku arr={sudoku}/>)
